import React from 'react';
import { AppBar, Toolbar, Typography } from '@material-ui/core';

const NavBar = () => {
    return (
        <div>
            <AppBar position="static">
                <Toolbar className="container" position="container">
                    <Grid container sm={12}>
                        
                    </Grid>
                </Toolbar>
            </AppBar>
        </div>
    )
}

export default NavBar;
